import{_ as e,c as o,o as s,b as t}from"./app.5b22e94d.js";const x=JSON.parse('{"title":"日更第九","description":"","frontmatter":{"title":"日更第九","date":"2018-08-19T00:00:00.000Z","draft":false},"headers":[],"relativePath":"note/2018/20180817.md"}'),a={name:"note/2018/20180817.md"},n=t("p",null,"十点二十三分，我吃完饭，回到这里，开始写一写东西。从昨天还是前天开始，我沉迷于对JavaScript的研究，主要是下载了几本书，简直是打开了新世界的大门，超越了以前的认知，我开始用JavaScript做很多事情，额，其实也没有做很多，主要是设想，也为验证书里面说的是真的。我设想做一个占卜的程序，通过一些输入，算出一个卦象，从而卜出吉凶。本来是想做的简单一点的，但是做了之后，发现有很大的改进空间，然后，继续做的时候，又发现问题了，现有技能储备不够，做不出来，只能遗憾的宣布失败，究其原因，是对这次项目的难度预估不足，没有做到合理的评估，没有足够的远见，虽说没做出什么东西来，倒也学到了不能盲目下手的道理，算是收获。",-1),c=t("p",null,"然后下午，我继续看书，书写的很有意思，我在床上翻来覆去看，一个姿势累了就换个姿势，不知不觉，过了很久。然后打电话的时候，应该是没缓过来，就说的干巴巴的，加上信号不好，通话就结束了，我以为是慕慕挂的，慕慕以为是我挂的，过来很久一段时间，才解开这个误会。",-1),_=t("p",null,"然后我又反复设想了我的目标，具体是要达成目的，其实只是有个大概目标，可能别人以为我是在说笑，但是我深知这是最有机会的一次，要我轻易放弃，机会不可能。我目前还处在一个原始积累的阶段，所以一切只是画饼，没谁信，慕慕勉强相信，可能是不愿意当面打击我，这点我是可以理解的，毕竟我这种人是少数，能理解我的，少数中的少数。",-1),r=t("p",null,"然后，晚上吃了干拌面，手擀面，大碗，口感味道都很好，就是我不小心要了大碗，结果没吃完，挺遗憾的，面汤不错。",-1),l=t("p",null,"---------------------昨晚忙忘了更，哎。就知道会有这天。",-1),d=[n,c,_,r,l];function i(p,u,f,h,m,v){return s(),o("div",null,d)}const B=e(a,[["render",i]]);export{x as __pageData,B as default};
